def create_namespaces_map(self):
    """ID: b39f969c-8b1b-4723-af74-9144f3be64ee"""
    namespaces_maps = [{}, {}]
    for res, hmap in zip(namespaces_maps, [self.internal_mods, self.external_mods]):
        for mod in hmap:
            for namespace in hmap[mod]["methods"]:
                res[namespace] = mod

    return namespaces_maps
